import oracle.odi.domain.odireference.*;
import oracle.odi.domain.adapter.*;
import oracle.odi.domain.adapter.topology.*;
import oracle.odi.domain.adapter.relational.*;
import oracle.odi.domain.adapter.project.*;
import oracle.odi.domain.adapter.project.IKnowledgeModule.ProcessingType;
import oracle.odi.domain.mapping.*;
import oracle.odi.domain.mapping.component.*;
import oracle.odi.domain.mapping.physical.*;
import oracle.odi.domain.mapping.generator.*;
import oracle.odi.domain.project.*;
import oracle.odi.mapping.generation.*;
import oracle.odi.domain.mapping.component.km.*;

public class LKM_Oracle_to_Oracle_DB_Link extends OracleToOracleDblinkCompKM {

  protected String isConcurrent;

  protected String stageTableAccessName;
  protected String srcViewAccessName;

  private mBinding = null;
  public void setBinding(Binding binding) {
    super.setBinding(binding);
    mBinding = binding;

    isConcurrent = physicalNode.getPhysicalDesign().isConcurrent()? "TRUE": "FALSE"
    stageTableAccessName = generatorContext.getAPNodeCollTableAccessName()
    srcViewAccessName = generatorContext.getAPNodeSourceViewAccessName(30)

    binding.setVariable("stageTableAccessName", stageTableAccessName);
    binding.setVariable("srcViewAccessName", srcViewAccessName);
    binding.setVariable("isConcurrent", isConcurrent);
  }

  public LKM_Oracle_to_Oracle_DB_Link() {

  }
}
